import react from 'react'
import '../css/NavBar.css';

const InterMenu = () => {
    return(
        <div className="InterMenuC">
            <ul>
                <li>Özel</li>
                <li>Medya</li>
                <li>Hayranlar</li>
                <li>Paylaş</li>
            </ul>
        </div>
    )
}

export default InterMenu;
